import {useHistory} from 'react-router-dom'
// import Button from '@mui/material/Button';
// import Container from '@mui/material/Container';
import {List, AppBar, Toolbar, Button, Container} from '@mui/material'

function Nav({updateUser}) {
    const history = useHistory()
    const handleLogout = () => {
        fetch('/logout', {
            method: 'DELETE',
        }).then(res => {
            if(res.ok) {
                updateUser(null)
                history.push('/authentication')
            }
        })
    }

    return (
        <Container sx={{color: 'primary.main'}}>
        // {/* <Container sx={{color:'#282828'}}> */}
            {/* <AppBar>
            <Toolbar > */}
            <Button onClick={() => history.push('/')} > Topher Emby </Button>
                <Button onClick={() => history.push('/groups')} >  Groups </Button>
                <Button onClick={() => history.push('/addrequest')} >  Add Request </Button>
                <Button onClick={() => history.push('/friendsusers')} >  Friends/Users </Button>
                <Button onClick={handleLogout} >  Logout  </Button>
            {/* </Toolbar> */}
            {/* </AppBar> */}
        </Container>
    )
}

export default Nav
